import React from 'react';

const Product = (props) => {

    console.log(props.name);

    return(
        <div className="card">
        <div className="card-body">
          <h5 className="card-title">{props.name}</h5>
          <p className="card-text"></p>
        </div> 
        </div>
    )
}

export default Product;
